    style='font-size:22.0pt;mso-bidi-font-size:11.0pt;line-height:105%'>Oceanía
    es un continente insular de la Tierra constituido por la plataforma
    continental de Australia y los archipiélagos de Melanesia, Micronesia y
    Polinesia. Históricamente se consideró que <span class=SpellE>Insulindia</span>
    también formaba parte de Oceanía.&#8203; Todas estas islas están
    distribuidas por el océano Pacífico.<o:p></o:p></span></p>
